import {
    HomeOutlined,
    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
  } from '@ant-design/icons';

let menuList = [
    {
        path:"/home",
        icon:<HomeOutlined/>,
        name:"首页"
    },
    {
        path:"/produts",
        icon:<SettingFilled/>,
        name:"商品",
        children:[
            {
                path:"/shop",
                icon:<SmileOutlined/>,
                name:"品类管理"
            },{
                path:"/shopping",
                icon:<SyncOutlined/>,
                name:"商品管理"
            }
        ]
    },{
        path:"/user",
        icon:<LoadingOutlined/>,
        name:"用户管理"
    },{
        path:"/role",
        icon:"",
        name:"角色管理"
    },{
        path:"/charts",
        icon:"",
        name:"数据",
        children:[
            {
                path:"/charts/bar",
                icon:"",
                name:"圆柱体"
            },{
                path:"/charts/pie",
                icon:"",
                name:"折线图"
            }
        ]
    }
]
export default menuList
